<!doctype html>
<!-- The Time Machine GitHub pages theme was designed and developed by Jon Rohan, on Feb 7, 2012. -->
<!-- Follow him for fun. http://twitter.com/jonrohan. Tail his code on https://github.com/jonrohan -->
<html>
<head>
    <meta charset="utf-8">
    <meta http-equiv="X-UA-Compatible" content="IE=edge,chrome=1">

    <link rel="stylesheet" href="stylesheets/stylesheet.css" media="screen">
    <link rel="stylesheet" href="stylesheets/github-dark.css">
    <script type="text/javascript" src="javascripts/jquery-2.1.1.js"></script>
    <script type="text/javascript" src="javascripts/handlebars-v3.0.3.js"></script>

    <title>Practice</title>
    <meta name="description" content="EveryDay Coding Practice">

    <meta name="viewport" content="width=device-width,initial-scale=1">

</head>

<body>

<div class="wrapper">
    <header>
        <h1 class="title">Practice</h1>
    </header>
    <div id="container">
        <p class="tagline">EveryDay Coding Practice</p>

        <div id="main" role="main">
            <div class="download-bar">
                <div class="inner">
                    <a href="https://github.com/W2C203/Practice/tarball/master" class="download-button tar"><span>Download</span></a>
                    <a href="https://github.com/W2C203/Practice/zipball/master" class="download-button zip"><span>Download</span></a>
                    <a href="https://github.com/W2C203/Practice" class="code">View Practice on GitHub</a>
                </div>
                <span class="blc"></span><span class="trc"></span>
            </div>

            <article class="markdown-body" id="fill_here">

            </article>

        </div>
    </div>
    <footer>
        <div class="owner">
            <p><a href="https://github.com/W2C203" class="avatar"><img
                    src="https://avatars2.githubusercontent.com/u/13357792?v=3&amp;s=60" width="48" height="48"></a> <a
                    href="https://github.com/W2C203">W2C203</a> maintains <a href="https://github.com/W2C203/Practice">Practice</a>
            </p>


        </div>
    </footer>
</div>
<div class="current-section">
    <a href="#top">Scroll to top</a>
    <a href="https://github.com/W2C203/Practice/tarball/master" class="tar">tar</a>
    <a href="https://github.com/W2C203/Practice/zipball/master" class="zip">zip</a><a href="" class="code">source code</a>
    <p class="name"></p>
</div>
<script type="text/javascript" src="javascripts/script.js"></script>
<script id="template1" type="text/x-handlebars-template">
    <h3><a href="#">{{question_title}}</a></h3>
    {{#each question_explain}}
    <p>{{{this}}}</p>
    {{/each}}
    {{#each example_picture}}
    <img src={{this}} alt=""/>
    {{/each}}
    <p>
        {{#each person}}
        <button><a href="{{this}}/{{../date}}/index.html" target="_blank" >{{this}}</a></button>
        {{/each}}
    </p>
</script>
</body>
</html>
